// convert a motif with Ns to regex
function motifToRegex(site) {
    return new RegExp(site.replace(/N/g, '[ATGC]'), 'gi');
}

// single or multiple enzyme digest
export function digest(sequence, selectedEnzymes) {
    let cuts = [0, sequence.length];

    for (const e of selectedEnzymes) {
        const regex = motifToRegex(e.site);
        let match;
        while ((match = regex.exec(sequence)) !== null) {
            cuts.push(match.index + e.cutIndex);
        }
    }

    cuts = [...new Set(cuts)].sort((a,b) => a - b);

    const fragments = [];
    for (let i = 0; i < cuts.length - 1; i++) {
        fragments.push(cuts[i+1] - cuts[i]);
    }

    return fragments.sort((a,b) => b - a);
}

